import React from "react";
import ConfigFooter from '../capas/footer/footer';
import ConfigHead from '../capas/head/head';
import ConfigBodyCv from "../capas/bodyCv/configBodyCv";



const Curriculum = () => {
    return(
    <>
        <ConfigHead/>
        <ConfigBodyCv/>
        <ConfigFooter/>
    </>  
    )
};

export default Curriculum;
